import React from 'react';
import './swanspiration.css'

const Swanspiration = ({ kittenFamiliar, swanspiration }) => {
  return(
    <article className='kit-card'>
      <img className='cat-pic' src={kittenFamiliar} alt='Adorable kitten familiar'/>
      <p className='ronspiration'>{swanspiration}</p>
    </article>
  )
}

export default Swanspiration;
